import jwt from 'jsonwebtoken';
import config from './config';

const getToken = (user) => {
    console.log("inside get token");
    return jwt.sign({
        _id: user._id,
        name: user.name,
        email: user.email,
        isAdmin: user.isAdmin
    }, config.JWT_SECRET, {
        expiresIn: '48h'
    });
}

export {getToken};
